import './App.css';

function App() {
  return (
    <div className="App">
      <nav id="desktop-nav">
        <div className="logo">Tushar Mahat</div>
        <div>
          <ul className="nav-links">
            <li><a href="#about">About</a></li>
            <li><a href="#projects">Projects</a></li>
            <li><a href="#contact">Contact</a></li>
            <li><a href="#home">Home</a></li>
          </ul>
        </div>
      </nav>
    </div>
  );
}

export default App;
